import React from 'react';
import './App.css';
import {Route, Link} from 'react-router-dom';

import HomePage from './pages/homepage.component';

const topics = (props) => {
  console.log(props);
  return (
    <div>
      <h1>TopicList </h1>

    </div>
  );
}

const topicDetails = (props) => {
  console.log(props);
  return (
    <div>
      <h1>TopicDetails Id {props.match.params.topicsId}</h1>
      <button onClick={()=> props.history.push('/topics/555')}>Topics</button>
    </div>
  );
}


function App() {
  return (
    <div>
        <Route exact  path="/" component={HomePage}/>
        <Route exact path="/topics" component={topics} />
        <Route  path="/topicDetails/:topicsId" component={topicDetails} />
    </div>
  );
}

export default App;
